Photos by @amivitale. Here are more ways to get involved and help those trying to flee after the Taliban's rapid return to power in Afghanistan.
@stephsinclairpix, @tooyoungtowed and @lynseyaddario have launched a fundraiser to support the safe evacuation of 160 high-risk Afghan female journalists and activists and their families. Time is critical. Donate today at tooyoungtowed.org (link in profile.) 

@washingtonianmag has put together a list of ways to help in the D.C. area, including donating for rides from the airport and hotel rooms, offering apartments for rent as well and buying or donating furniture and other goods to stock new apartments. Go to washingtonian.com/2021/08/16/you-can-help-afghan-refugees-get-resettled-in-the-dc-area/ to learn more (link in profile).

@qz has a list of organizations on the ground in Afghanistan to support as well as resources for those who wish to apply for refugee status, how to get help as a journalist in Afghanistan and also digital safety measures to take at qz.com/2048251/how-to-help-afghanistan/ (link in profile).

Please spread these resources and get involved. 

